Here is an optimized implementation of `strlen` using RISC-V vector intrinsics:
```c++
#include <riscv_vector.h>

size_t vlen(const char *s) {
  size_t len = 0;
  vuint8m1_t zero = {0};
  vuint8mf2_t pat = vle8_v_i32m2(zero, 1); // pattern to find null character (0x00)

  for (; ; ) {
    vuint8m1_t chunk;
    vle8_v_u8m1(&chunk, s + len);
    vmask_t mask = vmpopc_m_b1(vmv_xori_wi16_m(vmsl_VU_B1(chunk, pat), 0x01));
    if (vmcnt_m_b1(mask) == 0) { // all bytes in chunk are non-zero, keep going!
      len += VLENB; // increment by the length of the vector register (in bytes)
      continue;
    }
    break;
  }

  // we found a zero, now search within the last chunk for it.
  for (int i = 0; i < VLENB; ++i) {
    if (*(s + len - VLENB + i) == '\0') {
      return len - VLENB + i;
    }
  }

  __builtin_unreachable(); // should never reach here, as we already checked for the null terminator above.
}

