Alternatively you can use regular expressions:

```javascript 
const allAnchorTags = document.querySelectorAll('a');
let csvHrefs = [];

allAnchorTags.forEach((link) => {
    const href = link.href;
    if(href.match(/\.csv$/i)){
       csvHrefs.push(href)
    }  
})

console.log(csvHrefs); // array with all.csv links on the page.
```

This script will select all anchor tags on a web page then check each tag's `href` value against a regular expression (`/\.csv$/i`). If there is a match (case insensitive due to `/i` flag), it adds that link's URL to the `csvHrefs` array.

