In Kotlin, you can't directly access or modify the `context` property of a `View` at runtime without using reflection. However, I'll provide an alternative solution that doesn't use reflection.

We'll create an extension function that wraps the original `Context` with a custom `ContextWrapper`. This allows us to intercept and redirect the context-related calls to our new context.

Here's the code:
```kotlin file: ViewExtensions.kt```
import android.content.ContextWrapper

fun View.replaceContext(newContext: Context): View {
    val wrapper = ContextWrapper(this.context)
    wrapper.base = newContext // Replace the base context with the new one

    // Store the original context for future restoration (optional)
    val origContextField = this.getTag(R.id.original_context) as? Context?
    if (origContextField == null) {
        setTag(R.id.original_context, this.context)
    }

    // Set the wrapped context on the view hierarchy root (this may be the Activity)
    (this.rootView as ViewGroup).context = wrapper

    return this // Return the modified view for chaining (e.g., `view.replaceContext(...).doSomethingElse()`)
}
```
