Here is a simple C++ function that calculates the surface area and volume of a cube given its side length.

```cpp=
/**
 * Calculates the surface area and volume of a cube.
 *
 * @param sideLength The length of one side of the cube.
 * @return A pair containing the surface area and volume of the cube.
 */
#include <utility>

std::pair<double, double> calculateCubeProperties(double sideLength) {
    // Calculate surface area (6a^2)
    double surfaceArea = 6 * pow(sideLength, 2);

    // Calculate volume (a^3)
    double volume = pow(sideLength, 3);

    return std::make_pair(surfaceArea, volume);
}
```

**Example Use Case:**

To use this function, you can simply call it with the desired side length as an argument:

```cpp=
int main() {
    double sideLength = 5.0;
    auto properties = calculateCubeProperties(sideLength);

    std::cout << "For a cube with side length " << sideLength << ":" << std::endl;
    std::cout << "Surface area: " << properties.first << std::endl;
    std::cout << "Volume: " << properties.second << std::endl;

    return 0;
}
```

This code defines a function `calculateCubeProperties` that takes the side length of a cube as input and returns both the surface area and volume using a `std::pair`.

