Here is a simple example of how you can dynamically resize an array in C using the `realloc` function:

```csharp

#include <stdio.h>
#include <stdlib.h>

int main() {
    // Initialize variables 
    int size = 5;
    int *arr = (int*)malloc(size * sizeof(int));

    // Check if malloc was successful 
    if(arr == NULL) {
        printf("Memory not allocated.\n");
        exit(0);
    }

    // Fill the array with values 
    for(int i = 0; i < size; i++) {
        arr[i] = i;
    }

    // Print original array 
    printf("Original Array: ");
    for(int i = 0; i < size; i++) {
        printf("%d ", arr[i]);
    }
    printf("\n");

    // Increase size by 1 
    size += 1;

    // Reallocate memory for new size 
    int *temp = realloc(arr, size * sizeof(int));

    // Check if reallocation was successful 
    if(temp == NULL) {
        printf("Memory not reallocated.\n");
        free(arr);
        exit(0);
    } else {
        arr = temp;
    }

    // Add new value at the end 
    arr[size-1] = 10;

    // Print updated array 
    printf("Resized Array: ");
    for(int i = 0; i < size; i++) {
        printf("%d ", arr[i]);
    }
    printf("\n");

    free(arr);

    return 0;
}
```

