Here is a basic example of an Ethereum (ETH) lending and borrowing smart contract written in Solidity:
```solidity

pragma solidity ^0.8.0;

contract LendingContract {
    // Mapping to store lender's deposited Ether balance 
    mapping(address => uint256) public balances;

    // Mapping to keep track of outstanding loan amounts for each borrower 
    mapping(address => uint256) public loans;

    // Interest rate per year, represented as a decimal value (e.g., 5% = 0.05)
    uint256 public interestRate = 0.05 * 10**18; 

    // Function for users to deposit Ether into the contract 
    function deposit() payable external {  
        require(msg.value > 0, "Deposited amount must be greater than zero");

        balances[msg.sender] += msg.value;  
    }

    // Function to borrow Ether from the lenders' pool 
    function borrow(uint256 _amount) external {       
        // Ensure that requested borrow amount doesn't exceed deposited funds 
        require(_amount <= getAvailableLiquidity(), "Insufficient liquidity in the market"); 

        // Require sufficient collateral provided by the borrower before issuing loan 
        require(loans[msg.sender] == 0 || balances[msg.sender] >= _amount, "Borrower needs to provide sufficient collateral");

        // Update borrowers mapping to add current borrowing 
        loans[msg.sender] += _amount;

        // Send borrowed Ether directly to user account 
        payable(msg.sender).transfer(_amount); 
    }

    // Function to calculate available liquidity (available ETH to lend) within the contract 
    function getAvailableLiquidity() view internal returns (uint256){
        uint256 totalDeposits = address(this).balance; 

